import React from "react";
import ReactDOM from "react-dom";

import { Title } from "./components";

//create the render page ReactDom.render
function App() {
  return (
    <div>
      <div className="app">
        <h1> Please render</h1>
        <Title />
      </div>
    </div>
  );
}
ReactDOM.render(<App />, document.getElementById("app"));
